        assert!(!is_valid_email(""));
    }

    #[test]
    fn test_is_valid_email_no_at() {
        assert!(!is_valid_email("noatsign"));
    }

    #[test]
    fn test_is_valid_email_no_local() {
        assert!(!is_valid_email("@nodomain.com"));
    }

    #[test]
    fn test_is_valid_email_no_domain() {
        assert!(!is_valid_email("user@"));
    }

    #[test]
    fn test_is_valid_email_no_dot_in_domain() {
        assert!(!is_valid_email("user@nodot"));
    }

    #[test]
    fn test_is_valid_email_double_at() {
        assert!(!is_valid_email("user@@double.com"));
    }

